                    />
                </Grid>
                <Grid item lg={8} md={6} xl={8} xs={12}>
                    <AccountDetails 
                        auth={auth}
                    />
                </Grid>
            </Grid>
        </div>
    );
};
Account.propTypes = {
    auth: PropTypes.object,

    getCity: PropTypes.func
}
const mapStateToProps = state => ({
    auth: state.auth,
    citys: state.citys
});
export default connect(
    mapStateToProps,
    null
)(Account);
